import { Container } from '@mui/material';
import './App.css';
import { Feed } from './components/Feed';
import { Navbar } from './components/Navbar';
import { Rightbar } from './components/Rightbar';
import { Sidebar } from './components/Sidebar';

function App() {
  return (
    <Container >
     <Navbar/>
     <Sidebar/>
     <Rightbar/>
     <Feed/>
    </Container>
  );
}

export default App;
